import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import { withStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import CardDisplay from "./Card";
import { connect } from "react-redux";
import axios from "axios";
import Paper from "@material-ui/core/Paper";
import Card from "@material-ui/core/Card";
import { CardHeader } from "@material-ui/core";
const styles = theme => ({
  root: {
    flexGrow: 1,
    display: "flex",
    justifyContent: "center"
  },
  fab: {
    marginLeft: "90px",
    marginTop: "45px"
  },
  paper: {
    textAlign: "center",
    padding: theme.spacing.unit * 2.5,
    border: 2,
    borderColor: "#090909",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "24px",
    color: "#1C80B5"
  },
  label: {
    alignItems: "center",

    margin: theme.spacing.unit * 2,

    width: 800
  }
});
class Home extends React.Component {
  state = {
    cards: []
  };
  componentDidMount() {
    axios.get(`http://10.24.46.59:8080/carrierapi/getCarriers`).then(res => {
      const cards = res.data;
      console.log(cards);
      this.setState({ cards });
    });
  }
  handle = () => {
    this.props.history.push(`/admin/CarrierDetails`);
  };
  render() {
    const { classes } = this.props;
    console.log(this.props);
    return (
      <div className={classes.paper}>
        {/* <Paper className={classes.paper}> */}
        Welcome To Configurator Use This Screen To Manage and Add New Carriers
        {/* </Paper> */}
        <div
          className={classes.root}
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "70vh"
          }}
        >
          <Grid container xs={24}>
            {this.state.cards.map(card => (
              <Grid item xs={3}>
                <CardDisplay
                  key={card.id}
                  LocalcarrierCode={card.carrierName}
                  selected={true}
                />
              </Grid>
            ))}

            <Grid item xs={3}>
              <Fab
                size="large"
                aria-label="Add"
                onClick={this.handle}
                className={classes.fab}
              >
                <AddIcon />
              </Fab>
            </Grid>
          </Grid>
        </div>
      </div>
    );
  }
}
const mapStateToProps = state => {
  return state;
};

const Reduxhome = connect(mapStateToProps)(Home);
export default withStyles(styles)(Reduxhome);
